import React, { useContext } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { NavigationContext } from '../context/NavigationContext';
import '../styles/footer.css';

const Footer = () => {
    const navigate = useNavigate();
    const { setActiveDropdown } = useContext(NavigationContext);

    const handleNavClick = (path, dropdown) => {
        // Прокрутка вверх
        window.scrollTo({ top: 0, behavior: 'smooth' });
        
        // Установка активного выпадающего меню
        setActiveDropdown(dropdown);
        
        // Навигация
        navigate(path);
    };
    return (
        <footer className="footer">
            <div className="container">
                <div className="footer-content">
                    <div className="footer-section">
                        <h4>Контакты</h4>
                        <p>
                            <i className="fas fa-phone"></i> +7 (777) 777-77-77
                        </p>
                        <p>
                            <i className="fas fa-map-marker-alt"></i> г. Алматы, ул. Примерная, 123
                        </p>
                        <p>
                            <i className="fas fa-envelope"></i> info@pandakey.kz
                        </p>
                    </div>
                    
                    <div className="footer-section">
                        <h4>Навигация</h4>
                        <ul>
                            <li><Link to="/">Главная</Link></li>
                            <li><Link to="/services">Услуги</Link></li>
                            <li><Link to="/shop">Магазин</Link></li>
                            <li><Link to="/contacts">Контакты</Link></li>
                        </ul>
                    </div>
                    
                    <div className="footer-section">
                        <h4>Режим работы</h4>
                        <p>Пн-Пт: 9:00 - 18:00</p>
                        <p>Сб: 10:00 - 16:00</p>
                        <p>Вс: Выходной</p>
                    </div>

                    <div className="footer-section">
                        <h4>Мы в соцсетях</h4>
                        <div className="social-links">
                            <a href="https://instagram.com" target="_blank" rel="noopener noreferrer">
                                <i className="fab fa-instagram"></i>
                            </a>
                            <a href="https://whatsapp.com" target="_blank" rel="noopener noreferrer">
                                <i className="fab fa-whatsapp"></i>
                            </a>
                            <a href="https://telegram.org" target="_blank" rel="noopener noreferrer">
                                <i className="fab fa-telegram"></i>
                            </a>
                        </div>
                    </div>
                </div>
                
                <div className="footer-bottom">
                    <p>&copy; {new Date().getFullYear()} PandaKey. Все права защищены.</p>
                </div>
            </div>
        </footer>
    );
};

export default Footer;
